import React from 'react';

function TodoList (props) {

    let tasksArr = props.tasksObj;

    taskToDoList = (arr) => {
        for(let element of arr) {
            return(
                <li>{element}</li>
            )
        }
    }

    return(
        <div className='tasks-list'>
            <ul>
                {taskToDoList(tasksArr)}
            </ul>
        </div>
    )
}

export default TodoList;
